window.bookSummaryJSON = "<p>What's your lucky number? </p> <p>Lyla Wilder is done being the shy chemistry nerd extraordinaire. While every other college student is out having fun, Lyla is studying. With her cat. Well, she's played it \"safe\" quite enough, thank you. So she creates a \"College Bucket List\" - with item #7 being a night of uninhibited, mind-blowing sex.... </p> <p>But she needs some help from her man-whore best friend. </p> <p>Hockey player Beck Davenport thought Lyla's transformation would be subtle. Man, was he wrong. With every item she ticks off, Beck finds himself growing seriously hot for his sweet brainiac best friend. And if he's not careful, he'll end up risking their friendship in order to convince Lyla that he might just be her lucky #7.... </p>"; 
